import React, { useEffect, useState } from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";

// Komponensek az egyes útvonalakhoz
function Login() {
  return <h1>Login oldal</h1>;
}

function Register() {
  return <h1>Register oldal</h1>;
}

function CarPicker() {
  return <h1>Car Picker oldal</h1>;
}

function DatePicker() {
  return <h1>Date Picker oldal</h1>;
}

function Home() {
  return (
    <div>
      <h1>Üdvözlünk a főoldalon!</h1>
      <nav>
        <ul>
          <li><Link to="/login">Login</Link></li>
          <li><Link to="/register">Register</Link></li>
          <li><Link to="/carPicker">Car Picker</Link></li>
          <li><Link to="/datePicker">Date Picker</Link></li>
        </ul>
      </nav>
    </div>
  );
}

function App() {
  const [message, setMessage] = useState("");

  useEffect(() => {
    fetch("http://localhost:8080/api/greetings")
      .then((response) => response.json())
      .then((data) => setMessage(data.message))
      .catch((error) => console.error("Hiba történt:", error));
  }, []);

  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />
        <Route path="/carPicker" element={<CarPicker />} />
        <Route path="/datePicker" element={<DatePicker />} />
      </Routes>
      <footer>
        <h1>Fasz {message}</h1>
      </footer>
    </Router>
  );
}

export default App;
